    # similarity = 1 - error / (64 * 64)
    # # print(similarity)
    #
    # return similarity
    differs = set()
    for x in range(64):
        for y in range(64):
            d = abs(find[x, y] - base[x, y]) / 255
            if d > 0.3:
                differs.add(d)
    result = sum(differs) / len(differs)
    print(result)
    return result


